// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./Ownable.sol";

contract PropertyRegistry is Ownable { // Inherits Ownable for access control

  // Define a struct to store property details (limited on-chain storage)
  struct PropertyDetails {
    address owner;
  }

  // Mapping to store property information based on property ID
  mapping(uint256 => PropertyDetails) public properties;

  // Function to register a new property
  function registerProperty(uint256 propertyId, address newOwner) public onlyOwner {
    require(properties[propertyId].owner == address(0), "Property already exists");
    properties[propertyId] = PropertyDetails(newOwner);
  }

  // Function to transfer ownership of a property
  function transferOwnership(uint256 propertyId, address newOwner) public {
    require(properties[propertyId].owner == msg.sender, "You are not the owner");
    properties[propertyId].owner = newOwner;
  }

  // Function to retrieve ownership information for a specific property
  function getPropertyOwner(uint256 propertyId) public view returns (address) {
    return properties[propertyId].owner;
  }
}
